import React from "react";
import "./App.css"

class HeaderButtons extends React.Component{
    render(){
        return(
            <div>
                <button className='buttonRegistr'>Регистрация</button>
                <button className='buttonAutorisation'>Вход</button>
            </div>
        );
    }
}

export default HeaderButtons;
